import { StyleSheet, Text, View } from "react-native";
import React from "react";

const Upload = () => {
  return (
    <View style={styles.wrapper}>
      <Text style={{ fontSize: 30 }}>Upload</Text>
    </View>
  );
};

export default Upload;

const styles = StyleSheet.create({
  wrapper: {
    marginTop: 50,
    justifyContent: "center",
    alignItems: "center",
  },
});
